import React from 'react';//api
import { createRoot } from 'react-dom/client';//渲染页面的
import './style/base.less'
import App from './App'
import store from './store';
import { Provider } from 'react-redux';
import { createBrowserRouter, HashRouter, RouterProvider } from 'react-router-dom'

import Foot from './components/Layout/FootPlay';
import Layout from './components/Layout/layout';
import FindMusicContent from './components/FindMusic/Content';

const rootElement = document.getElementById('root');
const root = createRoot(rootElement);

const router = createBrowserRouter([
  {
    path: '/',
    element: <FindMusicContent></FindMusicContent>,
    children: [
      {
        path: '/:contactId',
        element: <FindMusicContent></FindMusicContent>
      }
    ]
  }
])


root.render(
  <Provider store={store}>
    <RouterProvider router={router}>{/**配置使用路由对象 */}
      <App></App>
    </RouterProvider >
  </Provider>
);
